// 상단바용 공용 UI
import React from 'react';
import { Link } from 'react-router-dom';
import './css/NavBar.css';

function NavBar(){
    return (
        <div className='.background-class'>
            <>
                <h1 to="/" className="navbar-title-class"> InstaClone </h1>
                <nav className="navigation-class">
                <Link to="/" className='navigation-button-class'>홈</Link>
                <Link to="/about" className='navigation-button-class'>소개</Link>
                <Link to="/contact" className='navigation-button-class'>연락처</Link>
                </nav>
            </>
            

            <footer className="footer-class">
                <p className='footer-text-class'> 2025年, Blackwerf1257 </p>
            </footer>
        </div>
      );
}

export default NavBar;
